import "./Page3.css";

function Page3() {
  return (
    <div className="app">
      <div className="bg3">
        <span>
          <span className="headtext">Page3</span>
        </span>
        <div class="text">
          <a href="/page2" className="textlink">
            CLICK ON HERE TO START
          </a>
        </div>
      </div>
    </div>
  );
}

export default Page3;
